import React from 'react';

function PredictionPage({ predictionData }) {
    return (
        <div>
            <h1>Prediction Page</h1>
            {predictionData && (
                <div>
                    <h2>Prediction Data:</h2>
                    <pre>{JSON.stringify(predictionData, null, 2)}</pre>
                    {/* You can render additional components or UI elements based on the predictionData */}
                </div>
            )}
            {!predictionData && (
                <p>No prediction data available. Ensure that you have made a prediction first.</p>
            )}
            {/* Add styling and structure as needed */}
        </div>
    );
}

export default PredictionPage;
